import React, { useState } from 'react';
import './Dashboard.css';
import handleMoodSelection from './moodUtils';

function Dashboard({ userName, onLogout }) {
  const [selectedMood, setSelectedMood] = useState(null);
  const [moodReason, setMoodReason] = useState('');
  const [submittedData, setSubmittedData] = useState(null);

  const moods = [
    { id: 1, name: 'FANTASTIC', emoji: 'üòÑ', color: '#FFD700' },
    { id: 2, name: 'GOOD', emoji: 'üòä', color: '#87CEEB' },
    { id: 3, name: 'BAD', emoji: 'üòï', color: '#FFA500' },
    { id: 4, name: 'DEPRESSED', emoji: 'üò¢', color: '#696969' }
  ];

  const handleMoodSelect = (moodId) => {
    setSelectedMood(moodId);
  };

  const handleReasonChange = (e) => {
    setMoodReason(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!selectedMood) {
      alert('Please select your mood!');
      return;
    }

    if (!moodReason.trim()) {
      alert('Please share the reason for your mood!');
      return;
    }

    const selectedMoodObj = moods.find(mood => mood.id === selectedMood);
    
    // Get wellness guidance based on mood selection
    const moodGuidance = handleMoodSelection(selectedMoodObj.name.toLowerCase());
    
    setSubmittedData({
      mood: selectedMoodObj.name,
      emoji: selectedMoodObj.emoji,
      reason: moodReason,
      guidance: moodGuidance
    });

    console.log('Mood Data:', {
      mood: selectedMoodObj.name,
      reason: moodReason,
      guidance: moodGuidance,
      timestamp: new Date().toLocaleString()
    });
  };

  const handleResetForm = () => {
    setSelectedMood(null);
    setMoodReason('');
    setSubmittedData(null);
  };

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <div className="header-content">
          <h1 className="dashboard-title">MindMate</h1>
          <button className="logout-button" onClick={onLogout}>
            Logout
          </button>
        </div>
        <p className="welcome-message">Welcome, <span className="user-name">{userName}</span>! üëã</p>
      </div>

      <div className="dashboard-content">
        {!submittedData ? (
          <div className="mood-form-container">
            <h2 className="mood-question">How are you feeling today?</h2>

            {/* Mood Selection */}
            <div className="mood-options">
              {moods.map((mood) => (
                <button
                  key={mood.id}
                  className={`mood-button ${selectedMood === mood.id ? 'selected' : ''}`}
                  onClick={() => handleMoodSelect(mood.id)}
                  style={{
                    borderColor: selectedMood === mood.id ? mood.color : '#ddd',
                    backgroundColor: selectedMood === mood.id ? `${mood.color}20` : 'white'
                  }}
                >
                  <span className="mood-emoji">{mood.emoji}</span>
                  <span className="mood-name">{mood.name}</span>
                </button>
              ))}
            </div>

            {/* Reason Input */}
            {selectedMood && (
              <div className="reason-form">
                <label htmlFor="moodReason" className="reason-label">
                  What was the reason for such mood?
                </label>
                <textarea
                  id="moodReason"
                  className="reason-input"
                  value={moodReason}
                  onChange={handleReasonChange}
                  placeholder="Share your thoughts, feelings, or what happened today..."
                  rows="5"
                />
              </div>
            )}

            {/* Submit Button */}
            <button className="submit-mood-button" onClick={handleSubmit}>
              Submit
            </button>
          </div>
        ) : (
          <div className="submission-success">
            <div className="success-card">
              <h2 className="success-title">Thank you for sharing! üôè</h2>
              <div className="mood-display">
                <span className="large-emoji">{submittedData.emoji}</span>
                <p className="displayed-mood">You're feeling <strong>{submittedData.mood}</strong></p>
              </div>
              <div className="reason-display">
                <p className="reason-title">Reason shared:</p>
                <p className="reason-text">{submittedData.reason}</p>
              </div>

              {/* Wellness Guidance Section */}
              {submittedData.guidance && (
                <div className="wellness-guidance-section">
                  <div className="wellness-message-box">
                    <p className="wellness-message-text">
                      {submittedData.guidance.wellnessMessage}
                    </p>
                  </div>

                  <div className="recommended-action-box">
                    <p className="guidance-label">
                      <span className="action-icon">{submittedData.guidance.actionIcon}</span>
                      {submittedData.guidance.recommendedAction}
                    </p>
                    <p className="action-suggestion">
                      {submittedData.guidance.suggestion}
                    </p>
                  </div>
                </div>
              )}

              <p className="encouragement-message">
                Take care of yourself! We're here to support you. üíô
              </p>
              <button className="reset-button" onClick={handleResetForm}>
                Update Your Mood
              </button>
            </div>
          </div>
        )}
      </div>

      <div className="dashboard-footer">
        <p className="footer-text">Remember, it's okay to feel any emotion. MindMate is here to help! üåü</p>
      </div>
    </div>
  );
}

export default Dashboard;
